        <div className='main-box'>
            <SelectionList 
                list_type='backend-data' 
                object='audiofile' 
                selectable={true} 
                updateSelected={handleListSelection}
            />
            <Waveform 
                data={waveform_data}/>
        </div>
    )
}

export default Fourth
